import React, { Component } from 'react'
import { useState } from 'react'

export default function TogglerTwo() {

    const [isToggleOn, setToggle] = useState('ON')

   const hanClick = () => {
        isToggleOn  ? false : 'ON';
        setToggle(isToggleOn)
      }

    return (
        <div>
            <button onClick={hanClick}>
            {isToggleOn}
          </button>
        </div>
    )
}
